import React from 'react';
import {Link} from 'react-router-dom';

function NavbarComponent(){
    return(
        // <nav className='navigation-bar'>
        //     <ul className='navigation-list-items'>
        //     <li className='navigation-list-item'><Link className='navigation-link' to='/'>Home</Link></li>
        //     <li className='navigation-list-item'><Link className='navigation-link' to='/saved'>Saved Weather Points</Link></li>
        //     </ul>
        // </nav>
        <header>
        <div className="container container-flex">
            <div className="header-title-container">
                <h1 className="header-title">Living the simple life</h1>
                <p className="header-subtitle">a blog exploring minimalism in life</p>
            </div>
            <nav className="navigation">
                <ul className="navigation-list">
                    <li className="navigation-list-item"><Link to="/" className="navigation-link">Home</Link></li>
                    <li className="navigation-list-item"><Link to="/saved" className="navigation-link">Saved Weather Points</Link></li>

                </ul>
            </nav>
        </div>
    </header>
    )
}
export default NavbarComponent;
